import logo from "./assets/investment-calculator-logo.png";
import Form from "./Components/NewInvestment/InvestmentForm";
import Header from "./Components/UI/Header";
import Table from "./Components/UI/Table";
import { useState } from "react";
function App() {
  const [title_, setTitle] = useState("Header Title");
  const [logo_, setLogo] = useState(logo);

  return (
    <div>
      <Header imageAtr={logo_} title={title_} />
      <Form onSubmit={calculateHandler} />
      <Table>
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          {yearlyData.map((item, index) => (
            <tr key={index}>
              <td>{item.year}</td>
              <td>{item.savingsEndOfYear}</td>
              <td>{item.yearlyInterest}</td>
              <td>{item.totalYearlyContribution}</td>
              <td>{item.totalSavings}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
}

export default App;
